import styled from '@emotion/styled'

function Card ({ post }){
    
    const { API_URL } = process.env;

    return(
        <CardStyled>
            <div className = "body">
                <h3>{ post.post_title }</h3>
                <p dangerouslySetInnerHTML = {{ __html: post.description }} />
            </div>
        </CardStyled>
    )
}

const CardStyled = styled.div`

`
export default Card
